import React from 'react'
const tasklist = [
    {
        id: 1,
        text:'Doctor Appointment',
        day: 'Feb 5th at 2:30pm',
    },
    {
        id: 2,
        text:'Meeting at School',
        day: 'Feb 6th at 1:30pm',
    },
    {
        id: 3,
        text:'Food Shopping',
        day: 'Feb 5th at 2:30pm',
    }

]
const Task = () => {
    return (
        <div>
            {tasklist.map((task) => (<h3 key = {task.id}>{task.text}</h3>))}
        </div>
    )
}

export default Task
